Calling out all you fashion and makeup enthusiasts, there is a new happening place in town which is going make you go crazy with all the discounts and offers they have, in case you still haven’t guessed it, it’s Phoenix Palassio! Think of everything beauty related you’ve always wanted to shop from and it’s there, all under one roof! I had the most amazing time when I went to check out brands like Colorbar USA, Forrest Essentials, Kiko and so many more. It this doesn’t convince you, I don’t know what will. So don’t waste time and check out before they run out of offers
