Hey Guys!
I recently visited the Phoenix Pallasio Mall @phoenixpalassio in Lucknow. I am so happy to have visited such a beautiful mall. The decor of the mall is aesthetically beautiful, it is spacious enough with 3 main entrances.
The mall has 300+ brands, 60+ brands have just launched in Lucknow for the first time. Brands like Starbucks, Kiko Milano, Mac, Armani Exchange etc, have launched. I am sure this mall is a level up for all the Lucknow

 You guys are going to love the mall. The few brands that I discovered during my recent visit are 
